  true,\n\t\"url\": null,\n\t\"notes\": \"Under the Bank Secrecy Act (BSA), 31 U.S.C.
  5311 et seq., and its implementing regulations at 31 C.F.R. Chapter X (formerly
  31 C.F.R. Part 103), FinCEN may bring an enforcement action for violations of the
  reporting, recordkeeping, or other requirements of the BSA. FinCEN's Office of Enforcement
  evaluates enforcement matters that may result in a variety of remedies, including
  the assessment of civil money penalties. For example, civil money penalties may
  be assessed for recordkeeping violations under 31 C.F.R u00a71010.415 (formerly
  31 C.F.R. u00a7103.29), or for reporting violations for failing to file a currency
  transaction report (CTR) in violation of 31 C.F.R. u00a71010.311 (formerly 31 C.F.R.
  u00a7103.22), a suspicious activity report (SAR) in violation of 31 C.F.R. u00a7
  1021.320 (formerly 31 C.F.R. u00a7103.21), or a report of foreign bank and financial
  accounts (FBAR) in violation of 31 C.F.R u00a71010.350 (formerly 31 C.F.R. u00a7103.24).
  FinCEN also takes enforcement actions against money services businesses (MSBs) for
  failure to register with FinCEN in violation of 31 C.F.R u00a71022.380 (formerly
  31 C.F.R. u00a7103.41).\",\n\t\"license_title\": \"Creative Commons CCZero\",\n\t\"extras\":
